pragma solidity ^0.4.24;

/**
 * @title Roles
 * @dev Library for managing addresses assigned to a Role.
 */
library Roles {
  struct Role {
    mapping (address => bool) bearer;
  }

  modifier onlyRealAccount(address account) {
    require(account != address(0),'Function requires a non-0 address');
    _;
  }

  modifier onlyAccountWithRole(Role storage role, address account) {
    require(!has(role, account),'Function requires address to have role');
    _;
  }

  /**
   * @dev give an account access to this role
   */
  function add(
                Role storage role,
                address account
              )
          internal
          onlyRealAccount(account)
          onlyAccountWithRole(role, account)
    {
      role.bearer[account] = true;
    }

  /**
   * @dev remove an account's access to this role
   */
  function remove(
                  Role storage role,
                  address account
                )
          internal
          onlyRealAccount(account)
          onlyAccountWithRole(role, account)
    {
      role.bearer[account] = false;
    }

  /**
   * @dev check if an account has this role
   * @return bool
   */
  function has(
                Role storage role,
                address account
              )
          internal
          view
          onlyRealAccount(account)
          returns (bool)
  {
    return role.bearer[account];
  }
}
